INSERT INTO `cache_field` VALUES ('field:node:1','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:87:\"Xandermar is available for corp to corp, contractual projects in the greater DC region.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:95:\"<p>Xandermar is available for corp to corp, contractual projects in the greater DC region.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1352305992,1),('field:node:3','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:491:\"Xandermar LLC was founded January 1, 2010. Our office is located in Frederick, MD - a few miles from Washington DC. We are a veteran/minority owned company with a team of a dozen employees and subcontractors. Everyone who works for Xandermar is physically located in the greater Washington DC region. With quick access to Baltimore/Washington Airport, Dulles International Airport and Reagan National Airport, Xandermar can in-person for short or long-term projects anywhere in the country. \";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:498:\"<p>Xandermar LLC was founded January 1, 2010. Our office is located in Frederick, MD - a few miles from Washington DC. We are a veteran/minority owned company with a team of a dozen employees and subcontractors. Everyone who works for Xandermar is physically located in the greater Washington DC region. With quick access to Baltimore/Washington Airport, Dulles International Airport and Reagan National Airport, Xandermar can in-person for short or long-term projects anywhere in the country.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1352305992,1),('field:node:4','a:1:{s:4:\"body\";a:0:{}}',0,1352305992,1),('field:node:5','a:1:{s:4:\"body\";a:0:{}}',0,1352305992,1),('field:node:6','a:1:{s:4:\"body\";a:0:{}}',0,1352305992,1),('field:node:7','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:460:\"Each project is clearly articulated via written professional agreement and purchase order. We meet with our clients, in person, to discuss needs, wants and budget. We also draft clear wire-frames and a solid data model that makes sense for the project. With a few different options that align project goals to budget, we then set reasonable and agreeable expectations for project completion. As always, our initial consultation and proposals are complimentary.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:468:\"<p>Each project is clearly articulated via written professional agreement and purchase order. We meet with our clients, in person, to discuss needs, wants and budget. We also draft clear wire-frames and a solid data model that makes sense for the project. With a few different options that align project goals to budget, we then set reasonable and agreeable expectations for project completion. As always, our initial consultation and proposals are complimentary.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1352306456,1),('field:node:8','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:233:\"After a couple of months of planning and re-design, our website is now up and running. Our new system allows clients to schedule appointments, use our agile project life-cycle system and more. Please let us know where we can improve.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:241:\"<p>After a couple of months of planning and re-design, our website is now up and running. Our new system allows clients to schedule appointments, use our agile project life-cycle system and more. Please let us know where we can improve.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1352306637,1),('field:taxonomy_term:6','a:0:{}',0,1352308016,1),('field:user:0','a:0:{}',0,1352307912,1),('field:user:1','a:0:{}',0,1352306267,1),('field_info_fields','a:4:{s:6:\"fields\";a:5:{i:1;a:16:{s:12:\"entity_types\";a:1:{i:0;s:7:\"comment\";}s:12:\"translatable\";s