INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'Xandermar is available for corp to corp, contractual projects in the greater DC region.','','filtered_html'),('node','page',0,3,3,'und',0,'Xandermar LLC was founded January 1, 2010. Our office is located in Frederick, MD - a few miles from Washington DC. We are a veteran/minority owned company with a team of a dozen employees and subcontractors. Everyone who works for Xandermar is physically located in the greater Washington DC region. With quick access to Baltimore/Washington Airport, Dulles International Airport and Reagan National Airport, Xandermar can in-person for short or long-term projects anywhere in the country. ','','filtered_html'),('node','page',0,7,7,'und',0,'Each project is clearly articulated via written professional agreement and purchase order. We meet with our clients, in person, to discuss needs, wants and budget. We also draft clear wire-frames and a solid data model that makes sense for the project. With a few different options that align project goals to budget, we then set reasonable and agreeable expectations for project completion. As always, our initial consultation and proposals are complimentary.','','filtered_html'),('node','blog',0,8,8,'und',0,'After a couple of months of planning and re-design, our website is now up and running. Our new system allows clients to schedule appointments, use our agile project life-cycle system and more. Please let us know where we can improve.','','filtered_html');
/*!40000 ALTER TABLE `field_data_body` ENABLE KEYS */;
UNLOCK TABLES;

