INSERT INTO `search_dataset` VALUES (1,'node',' welcome xandermar is available for corp to corp contractual projects in the greater dc region  ',0),(3,'node',' company xandermar llc was founded january 1 2010 our office is located in frederick md a few miles from washington dc we are a veteran minority owned company with a team of a dozen employees and subcontractors everyone who works for xandermar is physically located in the greater washington dc region with quick access to baltimore washington airport dulles international airport and reagan national airport xandermar can inperson for short or longterm projects anywhere in the country  ',0),(4,'node',' web ',0),(5,'node',' mobile ',0),(6,'node',' training ',0),(7,'node',' our project lifecycle each project is clearly articulated via written professional agreement and purchase order we meet with our clients in person to discuss needs wants and budget we also draft clear wireframes and a solid data model that makes sense for the project with a few different options that align project goals to budget we then set reasonable and agreeable expectations for project completion as always our initial consultation and proposals are complimentary  ',0),(8,'node',' xandermar s website rebuilt dgibson s blog after a couple of months of planning and redesign our website is now up and running our new system allows clients to schedule appointments use our agile project lifecycle system and more please let us know where we can improve  ',0);
/*!40000 ALTER TABLE `search_dataset` ENABLE KEYS */;
UNLOCK TABLES;

